css:
atom-text-editor .syntax--meta.syntax--delimiter.syntax--period,
atom-text-editor .syntax--keyword.syntax--operator.syntax--assignment.syntax--js,
atom-text-editor .syntax--variable.syntax--language.syntax--js {
  color: white !important;
}
.tree-view {
  background-color: #272822;
  font-size: 8pt !important;
}
.list-group li:not(.list-nested-item),
.list-tree li:not(.list-nested-item),
.list-group li.list-nested-item > .list-item,
.list-tree li.list-nested-item > .list-item {
  line-height: 22px;
}
.list-group .icon::before,
.list-tree .icon::before {
  font-size: 13px;
}
